import React, { Component } from 'react';
import { HashRouter as Router, Route, NavLink} from 'react-router-dom';
import {profil} from '../user/profil';
import {updateInfos} from '../user/updateInfos';
import {dashboard} from '../user/dashboard';

export class Parameters extends Component {
    
    constructor(props){
        super(props)
        this.state={
            documents:[
                {
                    id:1,
                    title:'Ecole normale supérieure',
                    date_registration:'12/02/2021'
                },
                {
                    id:2,
                    title:'Ecole nationale supérieure polytechnique de Yaoundé 1',
                    date_registration:'12/02/2021'
                },
                {
                    id:3,
                    title:'Facultés de médecine',
                    date_registration:'12/02/2021'
                }
            ],

        }
    }


    render(){

        const documents = this.state.documents
        const content = documents.map((document) =>
          
            <tr onClick={
                ()=>this.setState({
                     
                    title:document.title,
                    date_registration:document.date_registration
                    })}>
                <th scope="row">{document.title}</th>
                <td>{document.date_registration}</td>
            </tr>         
        );

        function showTable(){
            
            if(documents.length ===0){
                return(
                  <h5 style={{textAlign:'center',marginTop:100}}>
                      Aucun ticket dans cette rubrique</h5>
                )
            }else{
                return (
                    <div className="container-fluid">
              
                        <div className="table-wrapper-scroll-y my-custom-scrollbar">
                            <table className="table table-bordered table-hover mb-0">
                                <thead style={{backgroundColor:'orange'}}>
                                    <tr >
                                    <th scope="col">#</th>
                                    <th scope="col">Titre</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {content}
                                </tbody>
                            </table>
                        </div>
                    </div>
                )
            }    
        }


        return(
            <div>
                <div style={{marginLeft:'35%'}}>
                <Router>
                    <ul className="nav navbar-nav" >
                        <li>
                            <NavLink  exact to="/dashboard">Tableau de bord</NavLink>
                        </li>
                        <li>
                            <NavLink to="/profil">Mon profil</NavLink>
                        </li>
                        <li>
                            <NavLink to="/updateInfos">Modifier mes infos</NavLink>
                        </li>
                    </ul>               
                    <Route>
                        <Route exact path="/dashboard" component={dashboard}/>
                        <Route path="/profil" component={profil}/>
                        <Route path="/updateInfos" component={updateInfos}/>
                    </Route>
                </Router>
                </div>
                
                <div style={{paddingTop:100}}>
                {showTable()}
                </div>
                
            </div>    
        );
    }
}
